import React, { useEffect, useState } from 'react'
import { KeyboardAvoidingView, View} from 'react-native'
import { StyleSheet } from 'react-native'
import { Avatar, ListItem,Text } from 'react-native-elements'
import { db } from '../firebase';



const CustomList = ({id,chatName,enterChat}) => {
const [page,setPage]=useState([]);

useEffect(()=>{
    db.collection("customList").onSnapshot((snapshot) => {
        setPage(snapshot.docs.map((doc) => doc.data()));
      });

},[page])

    return (
    <View  style={styles.container}>
        <View style={styles.left}>
        {page.map((pages) => (
         <View style={styles.component}>
              <Avatar rounded containerStyle={styles.Text}source={
            {uri : 'data:image/jpeg;base64,'}
        }/>
        <Text style={styles.T1} h4>{pages.string}</Text>
        </View>))}
        </View>
        <View style={styles.right}>
        {page.map((pages) => (
        <View style={styles.component}>
        <Avatar rounded containerStyle={styles.Text} source={
            {uri : 'data:image/jpeg;base64,'}
        }/>
        <Text style={styles.T1} h4>{pages.string1}</Text>
        </View>))}
        </View>       
    </View>
    )
}

export default CustomList

const styles = StyleSheet.create({
    container:{
        display:'flex',
        flex:1,
        flexDirection:'row',
        alignItems:'center',
        justifyContent:'space-evenly'
    },
    left:{
        alignItems:'center',
        justifyContent:'space-evenly',
        paddingTop:115,
        marginRight:6
    },
    right:{
        alignItems:'center',
        justifyContent:'space-evenly',
        paddingTop:115,
    },
    Text:{
        paddingTop:2,
        paddingEnd:3
    },
    T1:{
        paddingBottom:6
    },
    component:{
        display:'flex',
        flexDirection:'row',
        paddingLeft:8,
        paddingVertical:10,
        borderColor:"#A5A8AC",
        borderWidth:2,
        borderRadius:5,
        width:175,
        marginBottom:20 

    }

})
